import React, {useState} from 'react';
import { Link } from 'react-router-dom';
import { Search, X, Bell, User, Calendar, Plus, ChevronDown, Users, Globe, Lock , Moon, Sun } from 'lucide-react';
import { useTheme } from '../styles/ThemeContext';
import '../styles/NavBar.css';
import { ReactComponent as Logo } from '../Assets/logo.svg';
import menuConfig from '../Config/MenuConfig.json';


const NavBar = () => {
  const { darkMode, toggleDarkMode } = useTheme();
  const [mobileSearchOpen, setMobileSearchOpen] = useState(false);

  const toggleMobileSearch = () => {
    setMobileSearchOpen(!mobileSearchOpen);
  };

  return (
    <div className="Tinoto-home" >
        <nav className={`tinoto-nav ${mobileSearchOpen ? 'mobile-search-open' : ''}`}>
      <div className="tinoto-nav-left">
        <Link to="/" className="tinoto-logo">
          <img src="/api/placeholder/120/40" alt="Tinoto logo" />
        </Link>
        <div className="tinoto-nav-links desktop-only">
          <Link to="/" className="tinoto-nav-link">Home</Link>
          <Link to="/travel-guides" className="tinoto-nav-link">Travel guides</Link>
          <Link to="/hotels" className="tinoto-nav-link">Hotels</Link>
        </div>
      </div>
      <div className="tinoto-nav-right">
        <div className={`tinoto-search-container ${mobileSearchOpen ? 'mobile-open' : ''}`}>
          <input type="text" placeholder="Explore by destination" className="tinoto-search-input" />
          <Search className="tinoto-search-icon desktop-only" />
          <X className="tinoto-search-close mobile-only" onClick={toggleMobileSearch} />
        </div>
        <button className="tinoto-login-button desktop-only">Log in</button>
        <button className="tinoto-signup-button desktop-only">Sign up</button>
        <button className="tinoto-mode-toggle" onClick={toggleDarkMode}>
          {darkMode ? <Sun size={20} /> : <Moon size={20} />}
        </button>
        <Search className="tinoto-mobile-search-icon mobile-only" onClick={toggleMobileSearch} />
      </div>
    </nav>
    </div>
  );
};

export default NavBar;
